void check_failures()
{
   output_ptr_pos = 0;

   clear_framebuffer();

   u32 a, b, a_out, b_out, sr;

   int i, j;

   int fail_pos = 0;
   int k;

   int tests_per_instr = num_test_vals*num_test_vals;

   for (k = 0; k < NUM_INSTRS; k++)
   {
      for (i = 0; i < tests_per_instr; i++)
      {
         a = output_ptr[output_ptr_pos++];
         b = output_ptr[output_ptr_pos++];
         a_out = output_ptr[output_ptr_pos++];
         b_out = output_ptr[output_ptr_pos++];
         sr = output_ptr[output_ptr_pos++];

         u32 my_a = sh2_results.instruction_results[k].results_of_value_combination[i].val[0];
         u32 my_b = sh2_results.instruction_results[k].results_of_value_combination[i].val[1];
         u32 my_a_out = sh2_results.instruction_results[k].results_of_value_combination[i].val[2];
         u32 my_b_out = sh2_results.instruction_results[k].results_of_value_combination[i].val[3];
         u32 my_sr = sh2_results.instruction_results[k].results_of_value_combination[i].val[4];

         if (fail_pos < 28)
         {
            if (a != my_a)
            {
               vdp_printf(&test_disp_font, 0 * 8, fail_pos * 8, 0xC, "k: %d i: %d a: 0x%08x 0x%08x",k,i,a,my_a);
               fail_pos++;
            }

            if (b != my_b)
            {
               vdp_printf(&test_disp_font, 0 * 8, fail_pos * 8, 0xC, "k: %d i: %d b: 0x%08x 0x%08x", k, i, b, my_b);
               fail_pos++;
            }
            if (a_out != my_a_out)
            {
               vdp_printf(&test_disp_font, 0 * 8, fail_pos * 8, 0xC, "k: %d i: %d aout: 0x%08x 0x%08x", k, i, a_out, my_a_out);
               fail_pos++;
            }
            if (b_out != my_b_out)
            {
               vdp_printf(&test_disp_font, 0 * 8, fail_pos * 8, 0xC, "k: %d i: %d bout: 0x%08x 0x%08x", k, i, b_out, my_b_out);
               fail_pos++;
            }
            if ((sr & 3) != (my_sr & 3))
            {
               vdp_printf(&test_disp_font, 0 * 8, fail_pos * 8, 0xC, "k: %d i: %d sr: 0x%08x 0x%08x", k, i, sr, my_sr);
               fail_pos++;
            }
         }
      }
   }
   if(fail_pos == 0)
      vdp_printf(&test_disp_font, 0 * 8, fail_pos * 8, 0xC, "all ok");
}

